   "source": [
    "The four diagnostic plots below provide information on whether the linear regression model is appropriate for this data. For the Residuals vs. Fitted plot, the red line is not horizontal indicating that the residuals are not following a linear pattern. For the Normal Q-Q plot, the points do not fall along the straight diagonal line near the right side of the graph indicating that the residuals may not be normally distributed - the numbered observations deviate even further from the line's tail end. For the Scale-Location plot, the red line makes a large dip near the center of the graph rather than remaining horizontal, which indicates that the equal variance (assumption of homoscedasticity) may be violated. For the Residuals vs. Leverage plot, the majority of the points do no fall outside of the dashed red lines, which indicates Cook's distance, except for the three numbered observations, which may be overly influential. "
