   "source": [
    "predicted_te2 <- predict(modelA2,newdata=baked_abAGE2_te)\n",
    "\n",
    "head(predicted_te2)\n",
    "\n",
    "# Calculate the outcome metrics\n",
    "\n",
    "rsq_te2 <- cor(baked_abAGE2_te$Age,predicted_te2)^2\n",
    "rsq_te2\n",
    "\n",
    "mae_te2 <- mean(abs(baked_abAGE2_te$Age - predicted_te2))\n",
    "mae_te2\n",
    "\n",
    "mse_te2 <- mean((baked_abAGE2_te$Age - predicted_te2)^2)\n",
    "mse_te2\n",
    "\n",
    "rmse_te2 <- sqrt(mean((baked_abAGE2_te$Age - predicted_te2)^2))\n",
    "rmse_te2"
   ]
  },
